#app4>.circle {
    width: 80px;
    height: 80px;
    border-radius: 50%;
    border: 1px solid red;
}

@keyframes change {
    0% {
        background: red;
    }
    100% {
        background: blue;
    }
}

#app4 .circle.active {
    animation: change 1s infinite alternate linear;
}
